import "./App.css";
import "./styles.css";
import { BrowserRouter as Router, Route, Routes  } from 'react-router-dom';

import NewListing from "./page/NewListing";
import PendingListing from "./page/PendingListing";
import CompletedListing from "./page/CompletedListing";

function App() {
  return (
    <Router>
      <div>
      <Routes >
        <Route path="/new" component={NewListing} />
        <Route path="/pending" component={PendingListing} />
        <Route path="/completed" component={CompletedListing} />
      </Routes >
      </div>
    </Router>
  );
}

export default App;
